Fuse = require("Shaderfuse/Fuse")

local ShaderFuse = {}



-- Folgende Variable nur vorübergehend zum Testen. Die unterschiedlichen
-- Varianten werden dann später in den verschiedenen Code-Generierungen
-- berücksichtigt werden müssen (Repository, Installer, Atom-Package).

local deployment_phase = 1 -- 1 = DEVELOPMENT, 2 = PRERELEASE, 3 = REACTOR



function ShaderFuse.begin_create()

    -- self:AddInput( info.Fuse.Name, "DctlFuseInfoFuseButtonDev", {IC_ControlPage = -1, INPID_InputControl = "ButtonControl", INP_DoNotifyChanged = false, INP_External = false, BTNCS_Execute = 'bmd.openurl("'.. ShaderFuse.Fuse.InfoURL ..'")' })
    self:AddInput( "src", "DctlFuseInfoFuseButtonDevSRC", {ICD_Width = 0.22, IC_ControlPage = -1, INPID_InputControl = "ButtonControl", INP_DoNotifyChanged = false, INP_External = false, BTNCS_Execute = 'bmd.openurl("https://github.com/nmbr73/Shadertoys/blob/main/Shaders/'.. ShaderFuse.Fuse.Category ..'/'.. ShaderFuse.Fuse.Name ..'.fuse")' })
    self:AddInput( "md", "DctlFuseInfoFuseButtonDevMD", {ICD_Width = 0.22, IC_ControlPage = -1, INPID_InputControl = "ButtonControl", INP_DoNotifyChanged = false, INP_External = false, BTNCS_Execute = 'bmd.openurl("https://github.com/nmbr73/Shadertoys/blob/main/Shaders/'.. ShaderFuse.Fuse.Category ..'/'.. ShaderFuse.Fuse.Name ..'.md")' })
    self:AddInput( ShaderFuse.Shadertoy.ID, "DctlFuseInfoShadertoyButtonDev", {ICD_Width = 0.44, IC_ControlPage = -1, INPID_InputControl = "ButtonControl", INP_DoNotifyChanged = false, INP_External = false, BTNCS_Execute = 'bmd.openurl("'.. ShaderFuse.Shadertoy.InfoURL ..'")' })



    if deployment_phase == 1 then

        -- Branding

        local red = '<img height="16" width="16" src="data:image/png;base64," />'
        local green = '<img height="16" width="16" src="data:image/png;base64," />'
        local gray = '<img height="16" width="16" src="data:image/png;base64," />'

        local label = ''

        if ShaderFuse.Fuse.isCompatible and ShaderFuse.Fuse.hasThumbnail then

            local branding ='<img height="18" src="data:image/png;base64," />'

            label = '<p align="center"><a href="https://github.com/nmbr73/Shadertoys">'.. branding ..'</a></p>'


        else

            if ShaderFuse.Fuse.hasThumbnail then
                label = label .. green
            else
                label = label .. red
            end

            for _ , k in pairs({'Windows_CUDA','Windows_OpenCL','macOS_Metal','macOS_OpenCL'}) do

                if ShaderFuse.Compatibility[k] == nil then
                    label = label .. gray
                elseif ShaderFuse.Compatibility[k] == true then
                    label = label .. green
                else
                    label = label .. red
                end
            end

            label = '<p align="center">'.. label ..'</p>'

        end

        self:AddInput(label,
            "DctlFuseBrandLabel_dev", {
            IC_ControlPage = -1 ,
            LINKID_DataType = "Text",
            INPID_InputControl = "LabelControl",
            LBLC_MultiLine = true,
            IC_NoLabel = true,
            IC_NoReset = true,
            INP_External = false,
            INP_Passive = true,
        })

    elseif deployment_phase == 2 then

        self:AddInput('<p align="center"><a href="https://github.com/nmbr73/Shadertoys"><img height="18" src="data:image/png;base64," /></a></p>',
            "DctlFuseBrandLabel", {
            IC_ControlPage = -1 ,
            LINKID_DataType = "Text",
            INPID_InputControl = "LabelControl",
            LBLC_MultiLine = true,
            IC_NoLabel = true,
            IC_NoReset = true,
            INP_External = false,
            INP_Passive = true,
        })

    elseif deployment_phase == 3 then

        self:AddInput('<p align="center"><a href="https://github.com/nmbr73/Shadertoys"><img height="20" width="210" src="data:image/png;base64," /></a></p>',
            "DctlFuseBrandLabel", {
            IC_ControlPage = -1 ,
            LINKID_DataType = "Text",
            INPID_InputControl = "LabelControl",
            LBLC_MultiLine = true,
            IC_NoLabel = true,
            IC_NoReset = true,
            INP_External = false,
            INP_Passive = true,
        })


    end
end



function ShaderFuse.end_create()

    local version_info=''

    if ShaderFuse.Fuse.Version =='' and ShaderFuse.Fuse.Date == '' then
      version_info=''
    elseif ShaderFuse.Fuse.Version ~='' and ShaderFuse.Fuse.Date == '' then
      version_info='Fuse version '.. ShaderFuse.Fuse.Version ..'<br />'
    elseif ShaderFuse.Fuse.Version =='' and ShaderFuse.Fuse.Date ~= '' then
      version_info=ShaderFuse.Fuse.Date ..'<br />'
    elseif ShaderFuse.Fuse.Version ~='' and ShaderFuse.Fuse.Date ~= '' then
      version_info='Version '.. ShaderFuse.Fuse.Version ..' - '.. ShaderFuse.Fuse.Date ..'<br />'
    end

    -- local page = (ShaderFuse.hasErrors and '❌ ' or '') .. 'Info'
    local page = 'Info'

    local attr = {
        ICS_ControlPage = page,
        IC_ControlPage = 1,
        LINKID_DataType = "Text",
        INPID_InputControl = "LabelControl",
        LBLC_MultiLine = true,
        IC_NoLabel = true,
        IC_NoReset = true,
        INP_External = false,
        INP_Passive = true
    }

    if version_info ~= '' then
        version_info = '<br /><span style="color:#4060a0; ">'.. version_info ..'</span>'
    end

    if ShaderFuse.hasErrors then
        self:AddInput('<p style="color:white; background-color:#505050; ">'..ShaderFuse.errorsHtml..'</p>', "DctlFuseErrorsDescription", attr )
    end

    local thumbnail_src='data:image/png;base64,'

    if ShaderFuse.Fuse.hasThumbnail then
        thumbnail_src= 'file://'.. ShaderFuse.Fuse.DirName .. '/' .. ShaderFuse.Fuse.Name .. '.png'
    end



    self:AddInput('<br /><p align="center">Shadertoy<br /><a href="https://www.shadertoy.com/view/'.. ShaderFuse.Shadertoy.ID ..'" style="color:white; text-decoration:none; font-size:x-large; ">'.. ShaderFuse.Shadertoy.Name ..'</a><br />by <a href="https://www.shadertoy.com/user/'.. ShaderFuse.Shadertoy.Author ..'" style="color:#a0a060; text-decoration:none; ">'.. ShaderFuse.Shadertoy.Author ..'</a><br /><span style="color:#a06060; ">'.. ShaderFuse.Shadertoy.License ..'</span></p><p align="center">DCTLified and DaFused by <a href="'.. (ShaderFuse.Fuse.AuthorURL == '' and "https://nmbr73.github.io/Shadertoys/" or ShaderFuse.Fuse.AuthorURL) ..'" style="color:#a0a060; text-decoration:none; ">'.. ShaderFuse.Fuse.Author ..'</a>'.. version_info ..'</p>', "DctlFuseInfoText", attr )
    self:AddInput( ShaderFuse.Fuse.Name.." Info ...", "DctlFuseInfoFuseButton", { ICS_ControlPage = page, IC_ControlPage = 1, INPID_InputControl = "ButtonControl", INP_DoNotifyChanged = false, INP_External = false, BTNCS_Execute = 'bmd.openurl("'.. ShaderFuse.Fuse.InfoURL ..'")' })
    self:AddInput( ShaderFuse.Shadertoy.Name.." Shadertoy ...", "DctlFuseInfoShadertoyButton", { ICS_ControlPage = page, IC_ControlPage = 1, INPID_InputControl = "ButtonControl", INP_DoNotifyChanged = false, INP_External = false, BTNCS_Execute = 'bmd.openurl("'.. ShaderFuse.Shadertoy.InfoURL ..'")' })
    self:AddInput('<br /><p align="center"><img width="320" height="180" src="'.. thumbnail_src ..'" /></p>', "DctlFuseInfoLabelThumbnail", attr )

    if ShaderFuse.Fuse.AuthorLogo then
        self:AddInput('<br /><p align="right"><a href="https://github.com/nmbr73/Shadertoys"><img width="'.. ShaderFuse.Fuse.AuthorLogo.Width ..'" height="'.. ShaderFuse.Fuse.AuthorLogo.Height ..'" src="data:image/png;base64,'.. ShaderFuse.Fuse.AuthorLogo.Data ..'" /></a></p>', "DctlFuseLogoLabel", attr)

        -- self:AddInput('<br /><p align="right"><a href="https://github.com/nmbr73/Shadertoys"><img '.. ShaderFuse.Fuse.AuthorLogo ..' /></a></p>', "DctlFuseLogoLabel", attr)
    end

    self:AddInput('<p>This version of the Fuse seems to come straight from the repository. It should thereby represent the lateste development snapshot - that is as long as you keep your working copy up to date. This type of installation - if done right - should allow you to easily test your own changes localy before contributing them to the origin.</p>', "DctlFuseInfoDescription", attr )



    -- ..'Reactor package v'..SHADERFUSES_REACTOR_PACKAGE_VERSION..' created '..SHADERFUSES_REACTOR_PACKAGE_DATE..'<br />'

end





function ShaderFuse.init( filepath, mode, noAssert )

    ShaderFuse.noAssert = noAssert
    ShaderFuse.error = nil

    ShaderFuse.Fuse = nil
    ShaderFuse.Shadertoy = nil
    ShaderFuse.Compatibility = nil
    ShaderFuse.CompatibilityIssues = nil
    ShaderFuse.FuRegister = nil

    filepath = filepath ~= nil and filepath or debug.getinfo(2, "S").source:sub(2)

    local fuse = Fuse:new(filepath,'development')
    fuse:readInfo()

    ShaderFuse.Fuse = {}

    for _ , k in pairs({'FilePath', 'Category', 'Name', 'DirName', 'InfoURL', 'Author', 'AuthorURL', 'AuthorLogo', 'Description', 'InfoURL', 'Version', 'Date', 'hasThumbnail', }) do
        ShaderFuse.Fuse[k] = fuse[k]
    end

    ShaderFuse.Shadertoy = fuse.Shadertoy
    ShaderFuse.Compatibility = fuse.Compatibility
    ShaderFuse.CompatibilityIssues = fuse.CompatibilityIssues
    ShaderFuse.FuRegister = fuse.FuRegister

    ShaderFuse.hasErrors = false
    ShaderFuse.errorsHtml = nil
    if fuse:hasErrors() then
        ShaderFuse.hasErrors = true
        ShaderFuse.errorsHtml = fuse:getErrorsHTML()
    end

end


return ShaderFuse
